import Navbar from "../components/Navbar";

const Index = () => (
    <div>
        <ul>
            <li><Link href="/"><a>Home</a></Link></li>
        </ul>
        <h1>Welcome to Dot Com Engineer</h1>
    </div>
);

export default Index;
